package freedom

import (
	"github.com/8treenet/freedom/internal"
	"github.com/8treenet/iris/v12"
	"github.com/8treenet/iris/v12/core/host"
	"github.com/go-redis/redis"
	"github.com/kataras/golog"
)

var (
	// app is a singleton of internal.Application. It is never nil.
	app *internal.Application
)

func initApp() {
	app = internal.NewApplication()
}

// Application Represents an application of freedom
type Application interface {
	// Install the database. A function that returns the Interface type is passed in as a handle to the database.
	InstallDB(f func() (db interface{}))
	// Install the redis. A function that returns the redis.Cmdable is passed in as a handle to the client.
	InstallRedis(f func() (client redis.Cmdable))
	// Install a custom data source. A function that returns the Interface type is passed in as a handle to the custom data sources.
	InstallCustom(f func() interface{})
	// Install the middleware for http routing globally.
	InstallMiddleware(handler iris.Handler)
	// Assigns specified prefix to the application-level router.
	// Because of ambiguous naming, I've been create SetPrefixPath as an alternative.
	// Considering remove this function in the future.
	InstallParty(relativePath string)
	// NewRunner Can be used as an argument for the `Run` method.
	NewRunner(addr string, configurators ...host.Configurator) iris.Runner
	// NewH2CRunner Create a Runner for H2C .
	NewH2CRunner(addr string, configurators ...host.Configurator) iris.Runner
	// NewAutoTLSRunner Can be used as an argument for the `Run` method.
	NewAutoTLSRunner(addr string, domain string, email string, configurators ...host.Configurator) iris.Runner
	// NewTLSRunner Can be used as an argument for the `Run` method.
	NewTLSRunner(addr string, certFile, keyFile string, configurators ...host.Configurator) iris.Runner
	// Go back to the iris app.
	Iris() *iris.Application
	// Return to global logger.
	Logger() *golog.Logger
	// Run serving an iris application as the HTTP server to handle the incoming requests
	Run(serve iris.Runner, c iris.Configuration)
	// Adds a builder function which builds a BootManager.
	BindBooting(f func(bootManager BootManager))
	// Install the middleware for the message bus.
	InstallBusMiddleware(handle ...BusHandler)
	InstallSerializer(marshal func(v interface{}) ([]byte, error), unmarshal func(data []byte, v interface{}) error)
}

// NewApplication Create an application.
func NewApplication() Application {
	return app
}

// Logger Return to global logger.
func Logger() *golog.Logger {
	return app.Logger()
}

// Prometheus Return prometheus.
func Prometheus() *internal.Prometheus {
	return app.Prometheus
}

// ServiceLocator Return serviceLocator.
// Use the service locator to get the service.
func ServiceLocator() *internal.ServiceLocatorImpl {
	return app.GetServiceLocator()
}

// WorkerFromCtx extracts Worker from a Context.
func WorkerFromCtx(ctx Context) Worker {
	if result, ok := ctx.Values().Get(internal.WorkerKey).(Worker); ok {
		return result
	}
	return nil
}

// ToWorker proxy a call to WorkerFromCtx.
func ToWorker(ctx Context) Worker {
	return WorkerFromCtx(ctx)
}

package freedom

import (
	"github.com/8treenet/freedom/internal"
	"github.com/8treenet/iris/v12/hero"
	"github.com/8treenet/iris/v12/mvc"

	iris "github.com/8treenet/iris/v12"
	"github.com/kataras/golog"
)

func init() {
	initApp()
	initConfigurator()
}

const (
	//TransactionKey for transaction DB handles in the first-level cache
	TransactionKey = internal.TransactionKey
)

type (
	// IrisResult represents an type alias to hero.Result
	IrisResult = hero.Result

	// IrisContext represents an type alias to iris.Context
	IrisContext = iris.Context

	// IrisBeforeActivation represents an type alias to mvc.BeforeActivation
	IrisBeforeActivation = mvc.BeforeActivation

	// IrisConfiguration represents an type alias to iris.Configuration
	IrisConfiguration = iris.Configuration
)

type (
	// Worker Request a runtime object.
	Worker = internal.Worker

	// Initiator Initialize the binding relationship between the user's code and the associated code.
	Initiator = internal.Initiator

	// Repository The parent class of the repository, which can be inherited using the parent class's methods.
	Repository = internal.Repository

	// Infra The parent class of the infrastructure, which can be inherited using the parent class's methods.
	Infra = internal.Infra

	// Entity is the entity's father interface.
	Entity = internal.Entity

	// DomainEvent Interface definition of domain events for subscription and publishing of entities.
	DomainEvent = internal.DomainEvent

	//UnitTest is a unit test tool.
	UnitTest = internal.UnitTest

	// BootManager Can be used to launch in the application.
	BootManager = internal.BootManager

	// Bus Message bus, using http header to pass through data.
	Bus = internal.Bus

	// BusHandler is the bus message middleware type.
	BusHandler = internal.BusHandler

	// Result is the controller return type.
	Result = IrisResult

	// Context is the context type.
	Context = IrisContext

	// Configuration is the configuration type of the app.
	Configuration = IrisConfiguration

	// BeforeActivation is Is the start-up pre-processing of the action.
	BeforeActivation = IrisBeforeActivation

	// LogFields is the column type of the log.
	LogFields = golog.Fields

	// LogRow is the log per line callback.
	LogRow = golog.Log
)

// Prepare A prepared function is passed in for initialization.
func Prepare(f func(Initiator)) {
	internal.Prepare(f)
}

// NewUnitTest Unit testing tools.
func NewUnitTest() UnitTest {
	return internal.NewUnitTest()
}

// DefaultConfiguration Proxy a call to iris.DefaultConfiguration
func DefaultConfiguration() iris.Configuration {
	return iris.DefaultConfiguration()
}

package freedom

import (
	"fmt"
	"io/ioutil"
	"os"
	"path"

	"github.com/BurntSushi/toml"
	"gopkg.in/yaml.v3"
)

var (
	// profileFallbackSearchDirs is a series of directory that is used to search
	// profile file if a profile file has not been found in other directory.
	profileFallbackSearchDirs = []string{"./conf", "./server/conf"}

	// configurator is a instance of Configurator. It is never nil.
	configurator Configurator

	// EnvProfileDir is the name of the environment variable for the search
	// directory of the profile
	EnvProfileDir = "FREEDOM_PROJECT_CONFIG"

	// ProfileENV is the name of the profile directory in environment variable
	ProfileENV = EnvProfileDir

	// TODO(coco): this variable seems has no effect, considering remove it.
	// cachedProfileDir is the cache of the profile path
	cachedProfileDir string
)

var _ Configurator = (*fallbackConfigurator)(nil)

// Configurer .
type Configurer = Configurator

// Configurator .
type Configurator interface {
	Configure(obj interface{}, file string, metaData ...interface{}) error
}

func initConfigurator() {
	SetConfigurator(newFallbackConfigurator())
}

// SetConfigurator assigns a Configurator to global configurator
func SetConfigurator(c Configurator) {
	configurator = c
}

// SetConfigurer assigns a Configurator to global configurator
func SetConfigurer(c Configurer) {
	SetConfigurator(c)
}

// Configure .
func Configure(obj interface{}, file string, metaData ...interface{}) error {
	return configurator.Configure(obj, file)
}

// detectProfileInFallbackSearchDirs accepts a string with the name of a
// profile file, and search the file in profileFallbackSearchDirs. It returns
// (a string with the path of the profile file, true) if the profile file has
// been found, and ("", false) otherwise.
func detectProfileInFallbackSearchDirs(file string) (string, bool) {
	for _, dir := range profileFallbackSearchDirs {
		filePath := JoinPath(dir, file)
		if IsDir(dir) && IsFile(filePath) {
			return filePath, true
		}
	}

	return "", false
}

// detectProfilePath accepts a string with the name of a profile file, and
// search the file in the directory which specified in environment variable.
// If the file has not been found, continue search the file by
// detectProfileInFallbackSearchDirs. It returns (a string with the path of
// the profile file, true) if the profile file has found, and ("", false)
// otherwise.
func detectProfilePath(file string) (string, bool) {
	dir := ProfileDirFromEnv()

	filePath := JoinPath(dir, file)
	if IsFile(filePath) {
		return filePath, true
	}

	return detectProfileInFallbackSearchDirs(file)
}

// ReadProfile accepts a string with the name of a profile file, and search
// the file by detectProfilePath. It will fill v with the configuration by
// parsing the profile into toml format, and returns nil if the file has
// found. It returns error, if the file has not been found or any error
// encountered.
func ReadProfile(file string, v interface{}) error {
	if path.Ext(file) == ".toml" {
		return readProfileByToml(file, v)
	}
	if path.Ext(file) == ".yaml" {
		return readProfileByYaml(file, v)
	}
	return nil
}

func readProfileByYaml(file string, v interface{}) error {
	filePath, isFilePathExist := detectProfilePath(file)

	if !isFilePathExist {
		return fmt.Errorf("file does not exist: %s", filePath)
	}
	filedata, err := ioutil.ReadFile(filePath)
	if err != nil {
		return err
	}

	Logger().Infof("[Freedom] Configuration was found: %s", filePath)
	return yaml.Unmarshal(filedata, v)
}

func readProfileByToml(file string, v interface{}) error {
	filePath, isFilePathExist := detectProfilePath(file)

	if !isFilePathExist {
		return fmt.Errorf("file does not exist: %s", filePath)
	}

	_, err := toml.DecodeFile(filePath, v)
	if err != nil {
		Logger().Errorf("[Freedom] Configuration decode error: %s", err.Error())
		return err
	}

	Logger().Infof("[Freedom] Configuration was found: %s", filePath)
	return nil
}

// fallbackConfigurator is used to act as a fallback if no any configurator
// are applied. It implements Configurator.
type fallbackConfigurator struct{}

// newFallbackConfigurator creates a fallbackConfigurator
func newFallbackConfigurator() *fallbackConfigurator {
	return &fallbackConfigurator{}
}

// Configured proxy a call to ReadProfile
func (*fallbackConfigurator) Configure(obj interface{}, file string, metaData ...interface{}) error {
	return ReadProfile(file, obj)
}

// JoinPath returns a string that joins any number of path elements into a
// single path, separating them with slashes.
func JoinPath(elems ...string) string {
	return path.Join(elems...)
}

// IsDir accepts a string with a directory path and tests the path. It returns
// true if the path exists and it is a directory, and false otherwise.
func IsDir(dir string) bool {
	stat, err := os.Stat(dir)
	if err != nil {
		return false
	}

	return stat.IsDir()
}

// IsFile accepts a string with a file path and tests the path. It returns
// true if the path exists and it is a file, and false otherwise.
func IsFile(path string) bool {
	stat, err := os.Stat(path)
	if err != nil {
		return false
	}

	return !stat.IsDir()
}

// ProfileDirFromEnv reads from environment variable with EnvProfileDir
func ProfileDirFromEnv() string {
	cachedProfileDir = os.Getenv(EnvProfileDir)
	return cachedProfileDir
}
